@Test
  public void prependedSql_isProper() {
    /* Given */
    RawSqlBuilder builder = new RawSqlBuilderImpl();

    /* When */
    mAlter.prependTo(builder);

    /* Then */
    assertThat(builder.toString(), is("ALTER"));
  }

